Information
------------------------------

Vinnie Jones: Russia's Toughest
As a former football hard man turned Hollywood strong-arm, Vinnie Jones is no stranger to serious roughhousing and fierce competition. But, he is up against his hardest challenge yet in Vinnie Jones: Russia's Toughest, as he goes head-to-head with men whose fearsome reputations enable them to handle some of the toughest jobs in Russia. In a series of six missions that span a vast and volatile land, Vinnie faces the dirty and dangerous worlds of the Train Driver, Bodyguard, Trawler man, Construction Worker, Poacher Warden and Cowboy. Vinnie braves temperatures as low as -50, sleeps out in the wild under threat of bears and wolves and slaughters a reindeer to survive; to learning the dark art of close personal protection with elite training in firearms to protect Moscow's rich and famous from ruthless kidnap gangs. Vinnie is pushed to the limit both mentally and physically as he performs some of the world's toughest jobs with the world's toughest men.


1)  Rail Men 
Vinnie gets down and dirty as he tackles the jobs of a Russian rail worker, then heads to the Arctic Circle to join the annual reindeer race.

2)  Bodyguards 
Vinnie Jones joins Russia's toughest bodyguards and helps to protect two of the country's richest stars from Moscow's ruthless kidnap gangs.

3)  Poacher Squad 
Vinnie Jones travels to Kamchatka to live and work with the poaching police protecting the welfare of a large population of brown bears.

4)  Construction Gangs 
Vinnie joins the construction gang who are building the Golden Horn Bay Bridge, working alongside them towards its completion.

5)  Hunters 
Vinnie Jones makes a big catch in Russia's Far East, works in a fish-processing factory and goes hunting with reindeer herders.

6)  Cowboys 
Vinnie works alongside both American and Russian cowboys as he tries to earn his spurs, Russian-style. Can he hack it with Russia's toughest?

